_routes2.default.when('/dev_tools', {
  resolve: {
    redirect: function redirect(Private, kbnUrl) {
      var items = Private(_dev_tools.DevToolsRegistryProvider).inOrder;
      kbnUrl.redirect(items[0].url.substring(1));
    }
  }
});

_feature_catalogue.FeatureCatalogueRegistryProvider.register(function (i18n) {
  return {
    id: 'console',
    title: i18n('kbn.devTools.consoleTitle', {
      defaultMessage: 'Console'
    }),
    description: i18n('kbn.devTools.consoleDescription', {
      defaultMessage: 'Skip cURL and use this JSON interface to work with your data directly.'
    }),
    icon: 'consoleApp',
    path: '/app/kibana#/dev_tools/console',
    showOnHomePage: true,
    category: _feature_catalogue.FeatureCatalogueCategory.ADMIN
  };
});
